import React from 'react';

const RenderPage = ( props ) => {
  console.log('after submit Render page : ',props.data);
  const renderData = ( ) => {

    if( props.data.length === 0 ) {
      return 'Loading...';
    }
    return props.data.map((el,i) => {
      return (
          <tr key={ i }>
            <td>{ el.movieName }</td>
            <td>{ el.ratings }</td>
            <td>{ el.duration }</td>
          </tr>
          );
        });
    }
    return (
      <div>
        <table className="ui celled table">

                  <tr>
                    <th>Movie Name</th>
                    <th>Ratings</th>
                    <th>Duration</th>
                  </tr>

                { renderData() }

          </table>
      </div>
    );
}

export default RenderPage;
